		"zs": "Rolą wałka rozrządu jest sterowanie otwieraniem i zamykaniem zaworu. W systemie zmiennych faz rozrządu elektroniczny zawór regulujący wałek rozrządu (lub zawór sterujący olejem, OCV) zmienia kąt nachylenia wałka rozrządu za pomocą ciśnienia oleju do nastawnika wałka rozrządu (mechanicznego) w celu zapewnienia, że zawór otwiera się i zamyka w optymalnym czasie.Rolą czujnika położenia wałka rozrządu (CMP) jest regulacja położenia wałka rozrządu (pozycja względna) przekazywana do Elektroniczna jednostka sterująca (ECU) w postaci sygnału napięciowego"
