		"sys": "Układ napędowy (określony przez producenta)",
		"zs": "Elektroniczny moduł sterujący wykrywa przerwy w zapłonie cylindrów, monitorując zmiany prędkości obrotowej wału korbowego. Jednak zmiany prędkości kół spowodowane złymi warunkami drogowymi mogą również powodować zmiany prędkości wału korbowego, co może wpływać na wykrywanie przerw zapłonu w cylindrze Układ zapobiegający blokowaniu się kół (ABS) System kontroli trakcji (TCS) może ocenić, czy pojazd jedzie w złych warunkach drogowych na podstawie sygnału z czujnika prędkości koła.Jeśli system wykryje poważne złe warunki drogowe, które mają wpływ na wykrywanie przerw zapłonu poinformuje elektroniczny moduł sterujący, aby wyłączył wykrywanie przerw zapłonu, aby zapobiec błędom zapisu. Kod błędu wskazuje, że elektroniczny moduł sterujący wykrył przerwę zapłonu, ale możliwe, że silnik nie miał stanu przerw zapłonu, ale był spowodowany złym warunków drogowych lub nieprawidłowego działania układów przeciwblokujących (ABS) i kontroli trakcji (TCS)"
