		"zs": "Turbosprężarka wykorzystuje impuls bezwładności spalin odprowadzanych z silnika do popychania turbiny, a turbina napędza współosiowy wirnik w celu sprężenia powietrza dolotowego, zwiększając w ten sposób moc pojazdu. Rola zaworu upustowego siłownik ma sterować wejściem do turbiny poprzez sterowanie przepływem spalin (z pominięciem reszty) w celu regulacji prędkości turbo, a tym samym maksymalnego ciśnienia doładowania"
