		"zs": "Zadaniem układu wentylacji skrzyni korbowej (PCV) jest przekierowanie przedmuchów w skrzyni korbowej (koniec procesu spalania pracy silnika, część niespalonej mieszanki wycieka z pierścieni tłokowych do skrzyni korbowej pod wysokim ciśnieniem ciśnienie (wyciek ten nazywany jest w branży gazem przedmuchowym) jest wprowadzany do kolektora dolotowego poprzez podciśnienie wytwarzane przez pracę silnika, a następnie przedmuchany gaz dostanie się do cylindra wraz ze świeżym powietrzem i zostanie spalony, zmniejszając w ten sposób zanieczyszczenie i poprawiając wydajność silnika"
