		"zs": "Przepustnica, zwana potocznie przepustnicą, jest sterowanym zaworem służącym do kontrolowania ilości powietrza dolotowego do silnika. Zadaniem czujnika położenia przepustnicy (TP) jest przekazywanie otwarcia przepustnicy w postaci sygnał elektryczny do Elektronicznej jednostki sterującej (ECU), jako jeden z podstawowych parametrów do sterowania wtryskiem paliwa do silnika.Przyczyny awarii obejmują awarię samego czujnika położenia przepustnicy (TP) lub jego obwodu lub złącza, objętość przepustnicy zawór jest zbyt brudny, awaria modułu sterującego przepustnicy, awaria elektronicznego modułu sterującego (PCM lub ECM) itp"
