		"sys": "Układ napędowy (określony przez producenta)",
		"zs": "Elektroniczny system stabilizacji toru jazdy obejmuje trzy systemy ABS (układ zapobiegający blokowaniu kół podczas hamowania), BAS (układ wspomagania hamowania) i ASR (układ zapobiegający poślizgowi podczas przyspieszania), które mają większą moc. Ta grupa systemów to zazwyczaj obsługuje funkcje ABS i ASR (system przeciwpoślizgowy jazdy, zwany też systemem kontroli trakcji) Pomaga pojazdowi w utrzymaniu dynamicznej równowagi analizując informacje o stanie jazdy pojazdu z różnych czujników, a następnie wysyłając polecenia korygujące do ABS i ASR. ESP pozwala pojazdowi zachować optymalną stabilność w każdych warunkach, zwłaszcza w sytuacjach nadsterowności lub podsterowności"
