		"des": "Zacisk 'L' alternatora - usterka obwodu",
		"sys": "Układ napędowy (określony przez producenta)",
		"zs": "Zadaniem generatora jest zamiana części energii mechanicznej silnika samochodu na energię elektryczną potrzebną samochodowi i ładującą akumulator. Generator ma zwykle 5 zacisków: Zacisk S - monitoruje napięcie akumulatora , zacisk IG - odpowiada za włączenie stacyjki regulatora napięcia, zacisk L - zamyka obwód do lampki sygnalizacyjnej, zacisk B - zacisk wyjścia głównego generatora (podłączony do akumulatora), zacisk F - obejście pola dla regulatora napięcia Powszechnie stosowany generator diagnostyczny Metoda polega na pomiarze napięcia akumulatora przed i po uruchomieniu silnika. Zwykle napięcie przed uruchomieniem wynosi około 12 V. Napięcie po uruchomieniu powinno wynosić około 14 V"
