		"zs": "Zespół kontroli przepływu kolektora dolotowego (IMRC) znajduje się pomiędzy kolektorem dolotowym a głowicą cylindrów. Aby poprawić osiągi silnika, każdy cylinder odpowiada dwóm kanałom dolotowym, z których jeden jest zawsze otwarty, a drugi otwiera się tylko gdy prędkość przekracza określoną wartość (powiedzmy 3000 obr./min). Rolą silnika wykonawczego IMRC jest otwieranie/zamykanie klapki zaworu kanału dolotowego zgodnie z poleceniem elektronicznej jednostki sterującej (ECU)"
